SENSE.DEF:
(a) To be successful, prosper; to be sufficient for a purpose;
    to be worthy or of value; ppl. availing, profitable, valuable;
    ppl. availed, effective, strong, worthy;
    (b) ~ again(es, to prevail against (sth.), overcome;
    (c) ~ to, to succeed in reaching (a place);
    (d) with infin.: to be able (to do sth.), succeed (in doing sth.);
    (e) law to be legally valid.
